import React, { Component } from 'react';
import log from '../../assets/img/log.png';

class Server extends Component {
    constructor(props) {
        super(props);
        this.state = {
            message: ""
        };
    }
    render() {
        return (
            <article>
                <h1>Server URL</h1>
            </article>
        );
    }
}

export default Server;
